import XCTest
import Archivable
import Sleuth

final class Base64Tests: XCTestCase {
    private var cloud: Cloud<Repository>.Stub!
    private let list = [
        "data:text/html;charset=utf-8;base64,PGltZyBzcmM9Imh0dHBzOi8vd3d3LmJldDM2NS5jb20vZmF2aWNvbi5pY28iPg==",
        "data:image/jpeg;base64,"
    ]
    
    
    override func setUp() {
        cloud = .init()
        cloud.archive.value = .new
    }
    
    func test() {
        list
            .map {
                ($0, cloud.validate(URL(string: $0)!, with: .antitracker))
            }
            .forEach {
                if case .allow = $0.1 { } else {
                    XCTFail("\($0.1): \($0.0)")
                }
            }
    }
}
